script: |
  super -f text -I q4768.spq | sort > q4768.out

inputs:
  - name: q4768.spq
    data: |
      SELECT DISTINCT * FROM tab1 (FORMAT parquet) AS cor0 WHERE + 27 NOT BETWEEN + col0 * 47 + + - col2 + + col0 * + + col2 AND + col2 - col2;
  - name: tab1

outputs:
  - name: q4768.out
    data: |
      51	14	96
      85	5	59
      91	47	68
